bioghist.p:
De rechtsvoorgangers van het Productschap Tuinbouw, het Productschap voor Siergewassen en het Productschap voor    Groenten en Fruit vormden voordat zij in 1996 werden opgeheven het Gemeenschappelijk Secretariaat van het Productschap voor Siergewassen en het Productschap voor Groenten en Fruit. Deze twee schappen zijn ingesteld krachtens de Instellingswet van 30 september 1954,gepubliceerd in het Staatsblad nummer 446 en 447 en in werking getreden met ingang van 1 januari 1956. 
Na opheffing van het Gemeenschappelijk Secretariaat is doormiddel van de Verordening van de Sociaal- Economische Raad van 20 december 1996 een productschap voor ondernemingen op het gebied van de teelt, van de be- en verwerking en handel in fruit, groenten en siergewassen, onder de naam Productschap Tuinbouw, ingesteld.
Deze instellingsverordening Productschap Tuinbouw, gepubliceerd in Staatscourant 1996, nr. 250 trad op 1 januari 1997 in werking.
Het bestuur van het Productschap Tuinbouw bestaat uit leden uit organisaties van ondernemers en uit leden van organisaties van werknemers. Daarnaast kent het productschap sectorcommissies voor aangelegenheden betreffende: 


bollen, knollen en wortelstokken van bloemgewassen;


bloemkwekerijproducten;


boomkwekerijproducten;


groente en fruit;


 buitenlands verduurzaamde producten, waaronder begrepen consumptie grondnoten en 
specerijen;


 hovenierswerkzaamheden.

Artikel 13 van het instellingsbesluit stelt dat aan het productschap is overgelaten de regeling of nadere regeling van de navolgende onderwerpen:  


de registratie van de ondernemingen waarvoor het productschap is ingesteld;


het verstrekken van de voor de vervulling van de taak van het productschap nodige gegevens;


de voor de vervulling van de taak van het productschap nodige inzage van boeken en bescheiden en bezichtiging en   opneming van bedrijfsmiddelen en voorraden van ondernemingen;


aangelegenheden verband houdende met de voortbrenging, de afzet, de verdeling en de aanwending, waaronder begrepen de opslag en de be- en verwerking van fruit, groenten en siergewassen, alsmede het verlenen van diensten;


 het instellen van fondsen in het belang van bedrijfsgenoten.

odd.p:
Openbare archiefstukken kunnen online worden aangevraagd en gereserveerd. U kunt dit ook via de terminals in de studiezaal van het Nationaal Archief doen. Om te kunnen reserveren dient u de volgende stappen te volgen: 


U maakt een profiel aan op www.gahetna.nl, en logt vervolgens in;


Via de archiefinventaris (alleen de beschrijvingen met rode nummers) selecteert u het gewenste archiefstuk door op de knop 'Reserveren' te klikken;


In het volgende scherm geeft u aan op welke dag u het archiefstuk wilt inzien;

Indien u zich bevindt in de studiezaal en een tafelnummer heeft ontvangen kunt u dit nummer vermelden. Als u geen tafelnummer heeft kunt u tafelnummer 777 laten staan;


Vervolgens bevestigt u uw reservering door deze te versturen.
